import { Link } from 'react-router-dom';
import "../styles/HomePage.css";

function HomePage() {
    return (
        <div>
            <div className="breadcrumbs">
                <Link to="/"></Link>
                {/*<a href="/">Главная</a>*/}
            </div>
            <h1 className="title">Ozon</h1>
            <Link to='/products'>Каталог</Link>
        </div>
    );
}

export default HomePage;
